function formatPriceTooltips() {

        var tooltips = document.querySelectorAll('.leaflet-tooltip');

                var priceMatch = text.match(/(\d+\.?\d*)/);
                if (priceMatch) {
                    var price = parseFloat(priceMatch[0]);
                    // –û–∫—Ä—É–≥–ª—è–µ–º –¥–æ —Ü–µ–ª–æ–≥–æ –∏ —Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º —Å –ø—Ä–æ–±–µ–ª–∞–º–∏

}
